export default GetGameData = (instance) => {
    const opponent = "";
    if(instance.vls.ta === 'HOU') {
        opponent = instance.vls.ta;
        const dataCached = true;
    }
    else{
        const opponent = (instance.hls.ta);
        const dataCached = true;
    }

    const GameData = {
        'date': instance.gdte,
        'time': instance.utctm,
        'city': instance.ac,
        'state': instance.as,
        'opponent': opponent,
        'status': instance.st
    };
    return GameData;
}
